import React, { Component } from 'react';
import knives from '../components/mockData';
// import knives from '../components/db';



var url = 'https://localhost:4000/knives';
fetch(url).then((response) => response.json())
          .then(function(knives) { console.log(knives) })
          .catch((error) => console.log(error));



class GetLocalPosts extends Component {
    constructor(props) {
        super(props);
        this.state = {
            knives: knives
        };
    }



    render() {
        const { knives } = this.state;
        return (
            <div>
                <ol className="item">
                    {
                        knives.map(knife => (
                            <div key={knife.id} align="start">
                                <table className='container showStopper'>
                                    <thead>
                                        <tr></tr>
                                    </thead>
                                    <tbody>
                                        <tr>
                                            <td className='show shane idStyling'>{knife.id}.</td>         
                                            <td className='show shane'>{knife.brand}</td>         
                                            <td className='show shane'>{knife.model}</td>          
                                            <td className='show shane'>{knife.bladeShape}</td>
                                            <td className='show shane'>{knife.steel}</td>
                                            <td className='show shane'>{knife.price}</td>
                                        </tr>
                                    </tbody>
                                </table>
                            </div>
                        ))
                    }
                </ol>
            </div>
        );
    }
}

export default GetLocalPosts;
